      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE ( NOT col2 IN ( + - col2 / + col0, 3 * 3 * ( col0 ) ) );
  - name: tab1

outputs:
  - name: q891.out
    data: |
      51	14	96
      85	5	59
      91	47	68
